// src/components/InputForm.js

import React, { useState } from 'react';
import { InformationCircleIcon } from '@heroicons/react/outline';

function InputForm({ onAddEntry }) {
  const [currentAge, setCurrentAge] = useState('');
  const [retirementAge, setRetirementAge] = useState('');
  const [spendingAmount, setSpendingAmount] = useState('');
  const [rateOfReturn, setRateOfReturn] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    const current = Number(currentAge);
    const retirement = Number(retirementAge);
    const amount = Number(spendingAmount);
    const rate = Number(rateOfReturn);

    if (current >= retirement) {
      alert('Retirement age must be greater than current age.');
      return;
    }

    if (amount <= 0) {
      alert('Spending amount must be greater than zero.');
      return;
    }

    if (rate <= 0) {
      alert('Rate of return must be greater than zero.');
      return;
    }

    onAddEntry({
      currentAge: current,
      retirementAge: retirement,
      spendingAmount: amount,
      rateOfReturn: rate / 100, // Convert percentage to decimal
    });

    // Clear inputs
    setCurrentAge('');
    setRetirementAge('');
    setSpendingAmount('');
    setRateOfReturn('');
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-6">
      {/* Current Age */}
      <div>
        <label htmlFor="currentAge" className="block text-sm font-medium text-secondary">
          Current Age
        </label>
        <div className="relative">
          <input
            type="number"
            id="currentAge"
            value={currentAge}
            onChange={(e) => setCurrentAge(e.target.value)}
            required
            min="0"
            className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-primary focus:border-primary"
            placeholder="e.g., 30"
          />
          <InformationCircleIcon className="h-5 w-5 text-gray-400 absolute top-3 right-3" title="Your current age in years." />
        </div>
      </div>

      {/* Retirement Age */}
      <div>
        <label htmlFor="retirementAge" className="block text-sm font-medium text-secondary">
          Retirement Age
        </label>
        <div className="relative">
          <input
            type="number"
            id="retirementAge"
            value={retirementAge}
            onChange={(e) => setRetirementAge(e.target.value)}
            required
            min={currentAge || "0"}
            className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-primary focus:border-primary"
            placeholder="e.g., 65"
          />
          <InformationCircleIcon className="h-5 w-5 text-gray-400 absolute top-3 right-3" title="Your planned retirement age in years." />
        </div>
      </div>

      {/* Initial Investment */}
      <div>
        <label htmlFor="spendingAmount" className="block text-sm font-medium text-secondary">
          Proposed Spending Amount ($)
        </label>
        <div className="relative">
          <input
            type="number"
            id="spendingAmount"
            value={spendingAmount}
            onChange={(e) => setSpendingAmount(e.target.value)}
            required
            min="0"
            className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-primary focus:border-primary"
            placeholder="e.g., 10000"
          />
          <InformationCircleIcon className="h-5 w-5 text-gray-400 absolute top-3 right-3" title="The initial amount you plan to spend." />
        </div>
      </div>

      {/* Annual Rate of Return */}
      <div>
        <label htmlFor="rateOfReturn" className="block text-sm font-medium text-secondary">
          Annual Rate of Return (%)
        </label>
        <div className="relative">
          <input
            type="number"
            step="0.01"
            id="rateOfReturn"
            value={rateOfReturn}
            onChange={(e) => setRateOfReturn(e.target.value)}
            required
            min="0"
            className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-primary focus:border-primary"
            placeholder="e.g., 5"
          />
          <InformationCircleIcon className="h-5 w-5 text-gray-400 absolute top-3 right-3" title="Expected annual return rate on your investment." />
        </div>
      </div>

      {/* Submit Button */}
      <div>
        <button
          type="submit"
          className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-white bg-primary hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary transition-colors duration-300"
        >
          Calculate
        </button>
      </div>
    </form>
  );
}

export default InputForm;
